import React from 'react';
import ReactDOM from 'react-dom';
   
class MyForm extends React.Component {
     
    onInputChange(event) {
        console.log(event.target.value);
    }
     
    render() {
        return (
            <div>
                <form>
                    <label>Enter text</label>
                    <input type="text"
                        onChange={this.onInputChange}/>
                </form>
            </div>
        );
    }
}
export default MyForm;
